    false,nt"url": null,nt"notes": "Migratory Sea Bird Watch (F038) is one
    of a group of seven datasets related tonMarine Birds from Coastal Alaska and Puget
    Sound Data (1974 -1982). Eachndataset uses the NODC Taxonomic Code to indicate species.nnMigratory
    Sea Bird Watch (F038) data type contains data from fieldnobservations of migratory
    bird species made at fixed offshore positions.nThese data are collected to provide
    information about migratory routesnand breeding locales of principal marine bird
    species. Position, date,nstart and end times, elapsed time, distance from shore,
    platform type,ncounting method and sampling technique are reported for each series
    ofnobservations. Environmental information may include meteorological andnsea surface
    conditions, ice cover, and tide height and trend. Speciesninformation may include
    age, sex, color, plumage, molt, behavior, numbernof individuals and number of species.
    These data were collected in 1977 -n1978 for coastal Alaska.",nt"owner_org":
